  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Geological Survey (USGS) Coastal
  and Marine Geology Program in Woods Hole, Massachusetts, is leading an effort to
  understand the regional sediment dynamics along the coastline of North and South
  Carolina. As part of the mulit-disciplinary Carolinas Coastal Change Processes Project,
  we are examining the interactions between oceanographic forcing, geologic conditions,
  and the resulting changes to topography in the inner shelf, nearshore, and subaerial
  beach regions. This dataset presents data from an oceanographic field study from
  January - May 2009 to investigate processes that control the dynamics of sediment
  transport at Diamond Shoals, NC. For more information see http://woodshole.er.usgs.gov/project-pages/cccp/index.html,
  http://woodshole.er.usgs.gov/operations/ia/public_ds_info.php?fa=2009-003-FA and
  http://woodshole.er.usgs.gov/operations/ia/public_ds_info.php?fa=2009-014-FA.\",\n\t\"owner_org\":
